import "./style/HomePage.css"

import React from 'react';
import Typewriter from "typewriter-effect";

const HomePage = () => {

    const onHover = (e) => {
        e.currentTarget.src = require("./../images/profile/drawn_profile.jpg")
    }

    const onRemove = (e) => {
        e.currentTarget.src = require("./../images/profile/profile.jpg")
    }

    return (
        <>
            <div id="page-container">
                <div id="profile-container">
                    <img src={require("./../images/profile/profile.jpg")}
                        onMouseOver={(e) => onHover(e)}
                        onMouseOut={(e) => onRemove(e)} />
                </div>

                <div id="about-container">
                    <h2 id="intro">
                        WELCOME! I'M ANGELA :)
                    </h2>

                    <p>
                        I'm a rising junior studying Computer Science at Brown University, and I'm
                        interested in 3D computer vision and graphics!
                        I'm currently working on 3D reconstruction research at
                        <a href="https://cs.brown.edu/people/ssrinath/ivl.html">Brown
                            Interactive 3D Vision and Learning Lab.
                        </a>
                    </p>
                </div>
            </div>
        </>
    )
}

export default HomePage;
